import React from 'react';
import { Link } from 'react-router-dom';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHouse } from '@fortawesome/free-solid-svg-icons';

function NotesPage() {
  return (
    <div>
      <h2>Página de Notas</h2>
      <p>¡Bienvenido a la página de Notas! Aquí podrás gestionar tus ideas y anotaciones.</p>

      <Link to="/">
        <button className="openModalButton"></button>
        <span className="homeIcon"><FontAwesomeIcon icon={faHouse} /></span>Inicio

      </Link>
    </div>


  );
}

export default NotesPage;
